import React from 'react';
import { Layout } from 'antd';
import "./index.css";

const { Header } = Layout;

class Nav extends React.Component {
    render() {
        return (
            <div className="nav-header-row">
                <div className="nav-header-row-logo" />
                <div className="nav-header-row-info"></div>
            </div>
        );
    }
}

export default Nav;
